script: |
  super -f text -I q5048.spq | sort > q5048.out

inputs:
  - name: q5048.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE ( + col1 + + col1 ) NOT BETWEEN - col0 * + col2 + - 36 + + + col2 + - 89 * + - ( + + 10 ) AND + - 52 * ( 84 );
  - name: tab1

outputs:
  - name: q5048.out
    data: |
      51	14	96
      85	5	59
      91	47	68
